import db from "./firebase.js"
import { doc, getDoc } from "firebase/firestore";
const docSnap = db.collection("users").get().then((querySnapshot) => {
    querySnapshot.forEach((doc) => {
        console.log(`${doc.id} => ${doc.data()}`);
    });
});
export  {docSnap}
